import styles from './SuccessCheckout.module.scss';

const SuccessCheckout = () => {
  return (
    <div className={styles.root}>
      <div className={styles.container}>
        <h1> You are almost done! </h1>
        <p> To find next details about payment and next details please <span>check your mail box</span> </p>
        <h3>Thank you for placing an order in our store</h3>
        <h3>We hope to see you again in close future</h3>
        <h3>Best regards from ArduRob Team!</h3>
      </div>
    </div>
  );
};

export default SuccessCheckout;
